import { toDisplayString } from '../clock';
export class BinInsOp {
    id;
    obj;
    ref;
    data;
    constructor(id, obj, ref, data) {
        this.id = id;
        this.obj = obj;
        this.ref = ref;
        this.data = data;
    }
    span() {
        return this.data.length;
    }
    name() {
        return 'bin_ins';
    }
    toString(tab = '') {
        const ref = toDisplayString(this.ref);
        return `"${this.name()}" ${toDisplayString(this.id)}!${this.span()}, obj = ${toDisplayString(this.obj)} { ${ref} ‚Üê ${this.data} }`;
    }
}
